import {BrowserRouter, Router, Route} from 'react-router-dom';
import Login from './pages/login';

import React from 'react'

const router = () => {
  return (
    <BrowserRouter>
        <Router>
            <Route element={Login} path='/login' />
        </Router>
    </BrowserRouter>

  )
}

export default router
